import React, { useState } from 'react';

const ToggleButton = () => {
  const [isToggled, setIsToggled] = useState(false);

  const handleToggle = () => {
    setIsToggled(!isToggled);
  };

  return (
    <button
      onClick={handleToggle}
      className={`w-[100px] h-[30px] flex items-center justify-between p-1 rounded-full transition-colors duration-300 ${
        isToggled ? 'bg-green-500' : 'bg-gray-300'
      }`}
    >
      <span
        className={`w-[14px] h-[14px] rounded-full transition-transform duration-300 ${
          isToggled ? 'transform translate-x-[70px] bg-white' : 'bg-white'
        }`}
      />
    </button>
  );
};

export default ToggleButton;
